import React from 'react'
import Link from 'next/link'

export default class Header extends React.Component {
  render() {
    return(
      <div>
        <HeaderMobile>
          {props.children}
        </HeaderMobile>
        <div>
          <div className='header-desktop'>
            <Link href="/">
              <a style={linkStyle}>Home</a>
            </Link>
            <Link href="/products">
              <a style={linkStyle}>Products</a>
            </Link>
            <Link href="/architecture">
              <a style={linkStyle}>Architecture</a>
            </Link>
            <Link href="/about">
              <a style={linkStyle}>About</a>
            </Link>
          </div>
          {props.children}
        </div>
      </div>
    )
  }
}

class HeaderMobile extends React.Component {
  state = {open: false}
  render() {
    let {open} = this.state
    return(
      <div className='header-mobile'>
        <div style={{
          background: 'white',
          height: 25,
          textAlign: 'center',
          color: 'black'
        }}>
          hello
        </div>
        <div style={open ? MobileMenuOpen : MobileMenuClosed}>
          <Link href="/">
            <a style={linkStyle}>Home</a>
          </Link>
          <Link href="/products">
            <a style={linkStyle}>Products</a>
          </Link>
          <Link href="/architecture">
            <a style={linkStyle}>Architecture</a>
          </Link>
          <Link href="/about">
            <a style={linkStyle}>About</a>
          </Link>
        </div>
      </div>
    )
  }
}

const MobileMenuOpen = {

}

const MobileMenuClosed = {

}

const linkStyle = {
  marginRight: 15
}
